!function(t){
	"use strict";
	var e={};
	t(document).ready(function(){
		return 	t(".delete-warning").length&&e.warning(),
				t(".status-warning").length&&e.warning(),!1
	}),
	e={
		warning:function(){
			return t(".delete-warning").on("click",function(){
				return swal({
					title:"Are you sure?",
					text:"You want to delete this file!",
					type:"warning",
					showCancelButton:!0,
					confirmButtonColor:"#ffffff",
					confirmButtonText:"Yes, delete it!",
					cancelButtonText:"No, cancel plx!",
					closeOnConfirm:!1,
					closeOnCancel:!1,
					confirmButtonColor:"#f60e0e"
				},function(t){
					t?swal({
						title:"Deleted!",
						text:"Your imaginary file has been deleted.",
						type:"success",
						confirmButtonColor:"#304ffe"
					}):swal({
						title:"Cancelled",
						text:"Your imaginary file is safe",
						type:"error",
						confirmButtonColor:"#f60e0e"
					})
				}),!1
			}),
			t(".status-warning").on("click",function(){
				return swal({
					title:"Are you sure?",
					text:"You want to change status of this ",
					type:"warning",
					showCancelButton:!0,
					confirmButtonColor:"#DD6B55",
					confirmButtonText:"Yes, change it!",
					cancelButtonText:"No, cancel plx!",
					closeOnConfirm:!1,
					closeOnCancel:!1,
					confirmButtonColor:"#f60e0e"
				},function(t){
					t?swal({
						title:"Changed!",
						text:"Status has been changed.",
						type:"success",
						confirmButtonColor:"#304ffe"
					}):swal({
						title:"Cancelled",
						text:"Your imaginary file is safe",
						type:"error",
						confirmButtonColor:"#f60e0e"
					})
				}),!1
			}),!1
		},
	}
}(jQuery);
	
